INSERT INTO `questionnaire_item_label` VALUES (586,4187,1,'Rice Crop Manager provides a farmer with a personalized crop management recommendation after they answer a series of questions. It is only for use with irrigated and rainfed rice grown in fields surrounded by bunds.\n\nThe farmer should answer the following questions for the upcoming rice crop before 8 days after sowing for direct seeded rice or before transplanting for transplanted rice. They should answer all questions separately for each rice field they desire a recommendation.'),(587,4187,4,'Rice Crop Manager provides a farmer with a personalized crop management recommendation after they answer a series of questions. It is only for use with irrigated and rainfed rice grown in fields surrounded by bunds.\n\nThe farmer should answer the following questions for the upcoming rice crop before 8 days after sowing for direct seeded rice or before transplanting for transplanted rice. They should answer all questions separately for each rice field they desire a recommendation.'),(588,4214,1,'For the person operating Rice Crop Manager'),(589,4214,4,'For the person operating Rice Crop Manager'),(598,4338,1,'Nutrient Manager calculates the requirements of rice, maize, and wheat crops for nitrogen, phosphorus, and potassium fertilizer. It provides a generic fertilizer recommendation based on the answers of the user to a series of general questions about crop-growing conditions.  \n\nNutrient Manager serves as a teaching tool and as a generic guide, particularly for researchers and extension. The optimal fertilizer requirements and management for a specific field can depend on variable factors not considered in detail in Nutrient Manager.\n\nNutrient Manager complements country-specific versions of Crop Manager, which provide a farmer with a personalized fertilizer and crop management recommendation for specific fields. Crop Manager is currently available and under development for selected crops and countries in Asia.\n\nNutrient Manager will direct users in Asia to relevant available versions of Crop Manager. Nutrient Manager therefore also serves as a transient tool to guide the calculation of fertilizer requirements before crop and country specific versions of Crop Manager are available.\n\nInstructions:\nThe user should select a crop and answer the questions for the crop'),(599,4338,3,'Nutrient Manager calculates the requirements of rice, maize, and wheat crops for nitrogen, phosphorus, and potassium fertilizer. It provides a generic fertilizer recommendation based on the answers of the user to a series of general questions about crop-growing conditions.  \n\nNutrient Manager serves as a teaching tool and as a generic guide, particularly for researchers and extension. The optimal fertilizer requirements and management for a specific field can depend on variable factors not considered in detail in Nutrient Manager.\n\nNutrient Manager complements country-specific versions of Crop Manager, which provide a farmer with a personalized fertilizer and crop management recommendation for specific fields. Crop Manager is currently available and under development for selected crops and countries in Asia.\n\nNutrient Manager will direct users in Asia to relevant available versions of Crop Manager. Nutrient Manager therefore also serves as a transient tool to guide the calculation of fertilizer requirements before crop and country specific versions of Crop Manager are available.\n\nInstructions:\nThe user should select a crop and answer the questions for the crop'),(600,4367,1,'Nutrient Manager assumes nitrogen fertilizer is applied as urea, and potassium fertilizer is applied as potassium chloride (muriate of potash, 0-0-60)\n\nNutrient Manager allows the user to select a phosphorus fertilizer source.'),(601,4367,3,'Nutrient Manager assumes nitrogen fertilizer is applied as urea, and potassium fertilizer is applied as potassium chloride (muriate of potash, 0-0-60)\n\nNutrient Manager allows the user to select a phosphorus fertilizer source.'),(602,4374,1,'A Crop Manager for [[GrownBeforeCropAnswer]] in [[CountrySelectAnswer]] is already available at http://cropmanager.irri.org.\n\nCrop Manager has more advanced decision making capabilities than Nutrient Manager. Crop Manager can provide a farmer with a personalized fertilizer and crop management recommendation for specific fields.'),(603,4374,3,'A Crop Manager for [[GrownBeforeCropAnswer]] in [[CountrySelectAnswer]] is already available at http://cropmanager.irri.org.\n\nCrop Manager has more advanced decision making capabilities than Nutrient Manager. Crop Manager can provide a farmer with a personalized fertilizer and crop management recommendation for specific fields.'),(604,4375,1,'A Crop Manager for [[GrownBeforeCropAnswer]] in [[IndiaStateAnswer]] is already available at http://cropmanager.irri.org.\n\nCrop Manager has more advanced decision making capabilities than Nutrient Manager. Crop Manager can provide a farmer with a personalized fertilizer and crop management recommendation for specific fields.'),(605,4375,3,'A Crop Manager for [[GrownBeforeCropAnswer]] in [[IndiaStateAnswer]] is already available at http://cropmanager.irri.org.\n\nCrop Manager has more advanced decision making capabilities than Nutrient Manager. Crop Manager can provide a farmer with a personalized fertilizer and crop management recommendation for specific fields.'),(606,4381,1,'The farmer should answer the questions for their maize plot for the season they desire recommended management practices.'),(607,4381,3,'The farmer should answer the questions for their maize plot for the season they desire recommended management practices.'),(608,4400,1,'For the user of Maize Crop Manager'),(609,4400,3,'For the user of Maize Crop Manager'),(610,4401,1,'Additional questions for the user of Maize Crop Manager'),(611,4401,3,'Additional questions for the user of Maize Crop Manager'),(612,4403,1,'Additional questions for the farmer'),(613,4403,3,'Additional questions for the farmer'),(614,4410,1,'Information about the farmer'),(615,4410,3,'Information about the farmer');
